import React from 'react';
import classes from './MealItemForm.module.css';

const MealItemForm = () => {
  return (
    <React.Fragment>
      <form className={classes.form}>
        <label>Amount</label>
        <input type="number" />
      </form>
      <button className={classes.button}>+Add</button>
    </React.Fragment>
  );
};

export default MealItemForm;
